import React from 'react'
import {useEffect, useState} from 'react'
import {useCookies} from 'react-cookie'
import {Link} from 'react-router-dom'
import Nav from '../components/Nav'
import Footer from '../components/Footer'

const Dashboard = () => {
    const [user, setUser] = useState(null)
    const [cookies, setCookie, removeCookie] = useCookies(['user'])

    const userId = cookies.UserId

    const getUser = async () => {
        try {
            const response = await axios.get('http://localhost:8000/user', {
                params: { userId }
            })
            console.log("Response from /user:", response.data)
            setUser(response.data)
            console.log("Updated user state:", user)
        } catch (error) {
            console.log(error)
        }
    }

    useEffect(() => {
        getUser()

    }, [])





    return (
        <>
        { user && 
            <>
            <Nav
            minimal={true}
            setShowModal={() => { } }
            showModal={false} />

            <div className="dashboard-card">
                <h1 className="dashboard-title">Welcome</h1>

                <button className="primary-button">My Matches</button>
                <button className="dashboard-button">Chat</button>
                <button className="dashboard-button">My Places</button>
                <button className="dashboard-button">My Profile</button>

            </div>
            <Footer/>
            </>
        }
        </>
    )


}

export default Dashboard
